import React, { useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/core';
// import { Box, Button, Container, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography, MenuItem, Select, Checkbox, ListItemText } from '@material-ui/core';
import { Bar } from 'react-chartjs-2';
import 'chart.js/auto';
import { Box, Checkbox, Container, ListItemText, MenuItem, Paper, Select, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography } from '@mui/material';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    paper: {
        padding: theme.spacing(2)
    },
    Container: {
        marginTop: theme.spacing(2)
    },
    box: {
        maxWidth: theme.spacing(100)
    },
    table: {
        minWidth: 650,
    },
    select: {
        minWidth: 200,
        marginBottom: theme.spacing(2),
    },
}));

export default function Usermoock() {
    const classes = useStyles();
    const [testsapi, setTestsAPI] = useState([]);
    const [selectedCategories, setSelectedCategories] = useState([]);

    useEffect(() => {
        fetch('https://script.google.com/macros/s/AKfycbz8n0pUzWpfu4wUA-Y8DDViIZysVgtqpGZ-S1R13EwCcZ3HscBVBPzkO6lZLa11yduE/exec')
            .then((res) => res.json())
            .then((data) => {
                setTestsAPI(data);
            });
    }, []);

    const handleCategoryChange = (event) => {
        setSelectedCategories(event.target.value);
    };

    const getUniqueCategories = () => {
        const categories = new Set(testsapi.map(test => test.category_Name));
        return Array.from(categories);
    };

    const filteredData = testsapi.filter(test =>
        selectedCategories.length === 0 || selectedCategories.includes(test.category_Name)
    );

    const chartData = {
        labels: filteredData.map(test => test.course_Name),
        datasets: [
            {
                label: 'Total Students',
                data: filteredData.map(test => test.totalStudents),
                backgroundColor: 'rgba(75, 192, 192, 0.6)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1
            }
        ]
    };

    return (
        <>
            <Container className={classes.Container} maxWidth='lg'>
                <Paper className={classes.paper}>
                    <Box maxWidth='lg' className={classes.box}>
                        <Box>
                            <Typography variant='h6'>User</Typography>
                        </Box>
                        <Box>
                            <Select
                                multiple
                                value={selectedCategories}
                                onChange={handleCategoryChange}
                                displayEmpty
                                className={classes.select}
                                inputProps={{ 'aria-label': 'Without label' }}
                                renderValue={(selected) => Array.isArray(selected) && selected.length === 0 ? <em>None</em> : selected.join(', ')}
                            >
                                <MenuItem disabled value="">
                                    <em>None</em>
                                </MenuItem>
                                {getUniqueCategories().map((category) => (
                                    <MenuItem key={category} value={category}>
                                        <Checkbox checked={selectedCategories.indexOf(category) > -1} />
                                        <ListItemText primary={category} />
                                    </MenuItem>
                                ))}
                            </Select>
                        </Box>
                    </Box>
                    <TableContainer component={Paper}>
                        <Table className={classes.table} aria-label="simple table">
                            <TableHead>
                                <TableRow>
                                    <TableCell align="center">Course_ID</TableCell>
                                    <TableCell align="center">Year_created</TableCell>
                                    <TableCell align="center">Month_created</TableCell>
                                    <TableCell align="center">Category_Name</TableCell>
                                    <TableCell align="center">Course_Name</TableCell>
                                    <TableCell align="right">TotalStudents</TableCell>
                                    <TableCell align="right">totalcer</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {filteredData.map((test) => (
                                    <TableRow key={test.course_ID}>
                                        <TableCell component="th" scope="row" align="center">
                                            {test.course_ID}
                                        </TableCell>
                                        <TableCell align="center">{test.year_created}</TableCell>
                                        <TableCell align="center">{test.month_created}</TableCell>
                                        <TableCell align="center">{test.category_Name}</TableCell>
                                        <TableCell align="center">{test.course_Name}</TableCell>
                                        <TableCell align="right">{test.totalStudents}</TableCell>
                                        <TableCell align="right">{test.totalcer}</TableCell>
                                    </TableRow>
                                ))}
                            </TableBody>
                        </Table>
                    </TableContainer>
                </Paper>
                <Paper className={classes.paper}>
                    <Typography variant='h6'>Chart</Typography>
                    <Bar data={chartData} />
                </Paper>
            </Container>
        </>
    );
}
